                                                                                {
                                                                                    "type": "textnode",
                                                                                    "content": "Una propuesta, un Sí y una decisión que tomamos juntos. Nuestro amor ha crecido en nosotros, ha madurado y florecido, a veces sencillo, otras caótico pero siempre maravilloso."
                                                                                },
                                                                                {
                                                                                    "tagName": "br",
                                                                                    "void": true
                                                                                },
                                                                                {
                                                                                    "type": "textnode",
                                                                                    "content": "\n                \n                          Así comienza una nueva etapa en nuestras vidas. Somos aventureros, dedicados, fuertes de carácter; los desafíos que hemos enfrentado nos han ayudado a crecer y madurar; debemos agradecer a esos retos porque con ellos nos hemos dado cuenta que juntos podemos lograr lo que nos proponemos."
                                                                                },
                                                                                {
                                                                                    "tagName": "br",
                                                                                    "void": true
                                                                                },
                                                                                {
                                                                                    "type": "textnode",
                                                                                    "content": "\n                          \n                          Tan sólo podemos decir que nuestra vida en estos momentos se encuentra completa y estamos listos para compartir el resto de nuestros días juntos."
                                                                                }
